
<html>
 <head>
  <title>JSxCAD Viewer</title>
  <meta charset="utf-8">
  <meta name="viewport" content="width=device-width, user-scalable=no, minimum-scale=1.0, maximum-scale=1.0">
  <style>
    div.book {
      height: 100%;
      overflow: scroll;
      margin-left: 20px;
      display: flex;
      flex-wrap: wrap;
      align-content: flex-start;
      justify-content: flex-start;
    }

    div.note.card {
      border: 1px dashed crimson;
      margin: 4px 4px;
      padding: 4px 4px;
      display: inline-block;
      width: fit-content;
      height: fit-content;
    }

    .note.log {
      font-family: "Arial Black", Gadget, sans-serif;
      color: red
    }

    .note.view {
      border: 1px dashed dodgerblue;
      margin: 4px 4px;
      padding: 4px 4px;
    }

    .note.orbitView {
      position: absolute;
      top: 0;
      width: 100%;
      height: 100%;
      z-index: 10000;
    }

    button.note.download {
      border: 2px solid black;
      border-radius: 5px;
      background-color: white;
      margin: 4px 4px;
      padding: 10px 24px;
      font-size: 16px;
      cursor: pointer;
      border-color: #2196F3;
      color: dodgerblue
    }

    button.note.download:hover {
      background: #2196F3;
      color: white;
    }

    .note th,td {
      border: 1px solid dodgerblue;
      padding: 5px;
    }
  </style>

    "sourceText": "md`\nClicking on a view maximizes and allows rotation and animation; use Escape to return.\n\n## Navigation\n\nYou can Control-Click on a link in the editor to visit a page.\n\n'''\nimport 'https://raw.githubusercontent.com/jsxcad/JSxCAD/master/nb/examples.nb';\n'''\n\nYou can click on links in a notebook, like so: [examples.nb](#JSxCAD@https://raw.githubusercontent.com/jsxcad/JSxCAD/master/nb/examples.nb)\n\nThe back button should return as usual, and urls can be bookmarked normally.\n\n## Stability\n\nPlease understand that JSxCAD is undergoing rapid evolution, and the API is not stable.\n\nYou will soon be able to select particular commits to work at to mitigate this somewhat.\n\n## Supported Browsers\n\nOnly the latest version of chromium is supported at this time.\n\nOther browsers may or may not work, and fixes to support them are a low priority.\n\nThis should change as JSxCAD becomes more mature.\n\n## Data Storage\n\nEdits are stored locally in the browser - they can be downloaded or published only explicitly.\n\n* Control-S will save local edits in the browser.\n* Shift-Enter will save, then run the notebook being edited.\n`;",

    "md": "\nClicking on a view maximizes and allows rotation and animation; use Escape to return.\n\n## Navigation\n\nYou can Control-Click on a link in the editor to visit a page.\n\n'''\nimport 'https://raw.githubusercontent.com/jsxcad/JSxCAD/master/nb/examples.nb';\n'''\n\nYou can click on links in a notebook, like so: [examples.nb](#JSxCAD@https://raw.githubusercontent.com/jsxcad/JSxCAD/master/nb/examples.nb)\n\nThe back button should return as usual, and urls can be bookmarked normally.\n\n## Stability\n\nPlease understand that JSxCAD is undergoing rapid evolution, and the API is not stable.\n\nYou will soon be able to select particular commits to work at to mitigate this somewhat.\n\n## Supported Browsers\n\nOnly the latest version of chromium is supported at this time.\n\nOther browsers may or may not work, and fixes to support them are a low priority.\n\nThis should change as JSxCAD becomes more mature.\n\n## Data Storage\n\nEdits are stored locally in the browser - they can be downloaded or published only explicitly.\n\n* Control-S will save local edits in the browser.\n* Shift-Enter will save, then run the notebook being edited.\n",
    "hash": "Era9rIwdLItZ0GRpSAZJ4VVtojQd6i0LZhbhZ3PxbVU=",

    const prepareViews = async (notebook) => {
      // Prepare the view urls in the browser.
      for (const note of notebook) {
        if (note.view && !note.url) {
          note.url = await dataUrl(Shape.fromGeometry(note.data), note.view);
        }
      }
      return notebook;
    }

    const run = async () => {
      const body = document.getElementsByTagName('body')[0];
      const bookElement = document.createElement('div');
      const notebookElement = await toDomElement(await prepareViews(notebook));
      bookElement.appendChild(notebookElement);
      body.appendChild(bookElement);
      bookElement.classList.add('book', 'notebook', 'loaded');
    };

    if (document.readyState === 'complete') {
      run();
    } else {
      document.onreadystatechange = () => {
        if (document.readyState === 'complete') {
          run();
        }
      };
    }
  </script>
